import React from "react";
import "../Locations.css";
import locations from "../locations.json";

// title, description, host, rating, location, equipments, pictures

const Informations = () => {
    return (
        <div className="infos__container">
            <h1 className="infos__title">Title</h1>
            <p className="infos__description">Description</p>
            <div className="infos__host">
                <img src="" alt="Host" className="infos__host--picture" />
                <p className="infos__host--name"></p>
                </div>
                <p className="infos__rating">Rating</p>
                <p className="infos__location">Location</p>
                <div className="infos__equipments">
                    <h2>Equipments</h2>
                    <ul>
                        <li>Equipment 1</li>
                        <li>Equipment 2</li>
                        <li>Equipment 3</li>
                    </ul>
                    </div>
        
        </div>
    );
};

export default Informations;
